    "7400415": {
        "Desc": "Habla con Anne",
        "Talk": [
            [
                {
                    "N": "_1005",
                    "T": "Anne..."
                },
                {
                    "N": "Anne",
                    "T": "..."
                },
                {
                    "N": "Anne",
                    "T": "#Lo siento, caballer{F#a}{M#o} {NICKNAME} y Paimon..."
                },
                {
                    "N": "Anne",
                    "T": "Conforme avanzábamos en la aventura, comencé a sentir que algo no iba bien. Cuando nos desviamos de la historia, empecé a comprender y recordar algunas cosas."
                },
                {
                    "N": "Anne",
                    "T": "Pero aún quiero salvar a la princesa. Ese es el motivo de mi existencia. Quiero salvarla para que esta historia pueda tener un maravilloso final."
                },
                {
                    "N": "Anne",
                    "T": "Ni siquiera sé quién es la princesa en realidad. Solo sé que es hermosa y bondadosa, y que quedó atrapada por la malicia del infame dragón Narciso..."
                },
                {
                    "N": "_1005",
                    "T": "No te preocupes, Anne. ¡Al menos lo pasamos muy bien cuando estábamos con la Brigada de Aventuras Cruz de los Narcisos!"
                },
                {
                    "N": "_1005",
                    "T": "..."
                },
                {
                    "N": "_1005",
                    "T": "#Entonces, {NICKNAME}, ¿tú ya sabías que esto pasaría?"
                },
                {
                    "N": "_0",
                    "T": "No, pensé que podríamos ayudar a Anne."
                },
                {
                    "N": "_1005",
                    "T": "Oh..."
                },
                {
                    "N": "_1005",
                    "T": "Humm... Entonces tal vez todavía podamos ayudarla."
                },
                {
                    "N": "Anne",
                    "T": "¿Eh?"
                },
                {
                    "N": "_1005",
                    "T": "Paimon no entendió nada de lo que dijo Marianne al final. Tú tampoco, ¿verdad, Anne?"
                },
                {
                    "N": "Anne",
                    "T": "Así es. No puedo evitar sentir que todo aquello de lo que hablaba eran cosas del pasado. Cosas malas..."
                },
                {
                    "N": "_1005",
                    "T": "#Paimon cree que es lo más justo para Anne, ¡y también para nosotr{F#a}{M#o}s!"
                },
                {
                    "N": "_1005",
                    "T": "Por eso, deberíamos averiguar al menos lo que ocurrió de verdad. ¡Tal vez así encontremos alguna solución!"
                },
                {
                    "N": "_1005",
                    "T": "#No importa si al final rescatamos a la princesa o no, o si descubrimos de qué estaba hablando Marianne, ¡lo importante es poder ayudar a Anne! ¿Verdad, {NICKNAME}?"
                },
                {
                    "N": "_0",
                    "T": "La historia aún no ha acabado, Anne."
                },
                {
                    "N": "_0",
                    "T": "Donde se cierra una puerta, se abre una ventana."
                },
                {
                    "N": "Anne",
                    "T": "Sí..."
                },
                {
                    "N": "_1005",
                    "T": "#Hay algo que Paimon no entiende. Si esto es solo una historia, ¿qué papel tenemos nosotr{F#a}{M#o}s entonces?"
                },
                {
                    "N": "_0",
                    "T": "Yo tampoco lo tengo claro."
                },
                {
                    "N": "_0",
                    "T": "Un imprevisto."
                },
                {
                    "N": "_0",
                    "T": "Un accidente."
                },
                {
                    "N": "_0",
                    "T": "Por eso podremos darle un final a esta historia."
                },
                {
                    "N": "_1005",
                    "T": "¡Ah, claro! ¡Paimon ya lo entiende! Por eso Anne vino a buscarnos y nos trajo a la historia."
                },
                {
                    "N": "_1005",
                    "T": "#Anne, tal vez no te hayas dado cuenta, pero desde que nos hiciste parte de esta historia, ¡hay un número infinito de posibilidades que antes no había! ¿Verdad, {NICKNAME}?"
                },
                {
                    "N": "_0",
                    "T": "Precisamente."
                },
                {
                    "N": "Anne",
                    "T": "*Solloza*... Muchas gracias..."
                },
                {
                    "N": "_1005",
                    "T": "#Pero nosotr{F#a}{M#o}s también necesitamos tu ayuda en lo que queda de aventura, Anne. ¿Se te ocurre algo sobre qué deberíamos hacer ahora?"
                },
                {
                    "N": "Anne",
                    "T": "Humm, deja que piense..."
                },
                {
                    "N": "Anne",
                    "T": "Hay un lugar en mis recuerdos que se llama <color=#00E1FFFF>Comunidad Cruz de los Narcisos</color>. Creo que guarda relación directa con lo ocurrido en el pasado."
                }
            ]
        ]
    },
